import ActivityCard from './ActivityCard';
import './App.css';
import { Container, Row, Col } from 'react-bootstrap'

function App() {
  return (
    <div className="App">
      <Container>
  {/* Stack the columns on mobile by making one full-width and the other half-width */}
  <Row className="test">
    <Col xs={12} md={8}>
      xs=12 md=8
    </Col>
    <Col xs={6} md={4}>
      xs=6 md=4
    </Col>
  </Row>

  {/* Columns start at 50% wide on mobile and bump up to 33.3% wide on desktop */}
  <Row>
    <Col xs={6} md={4}>
      xs=6 md=4
    </Col>
    <Col xs={6} md={4}>
      xs=6 md=4
    </Col>
    <Col xs={6} md={4}>
      xs=6 md=4
    </Col>
  </Row>

  {/* Columns are always 50% wide, on mobile and desktop */}
  <Row>
    <Col xs={6}>xs=6</Col>
    <Col xs={6}>xs=6</Col>
  </Row>
</Container>
       {/* <ActivityCard/> */}
    </div>
  );
}

export default App;
